@MonbergSF @KathrineKHoff @cekicozlem Nej måske ikke lige i denne gruppe, men jo kun fordi de ved at døren ville klappe efter dem.
Selvom jeg tvivler på om døren overhovedet ville klappe i efter dem..
Men det er jo et tydeligt tegn på hvorfor de er her, jo netop ikke af sikkerhedsmæssige hensyn, men socialle ydelser.

@2point5_boxer @KHegaard Desuden hører jeg sjældent 
nogen råbe død over andre i Jesus navn.

Derfor mangler du både referencer og beviser fra virkeligheden på, at kristendommen er lige så slem.
